import React, { Component } from "react";

class LeftArrowButton extends Component {
  render(props) {
    return (
      <div className="LeftArrowButton" onClick={props.onLeftClick}>
        <i className="fa fa-arrow-left fa-2x" />
      </div>
    );
  }
}

export default LeftArrowButton;
